history.origin:
The calendar and contents of the missal indicates Bohemia as the place of origin; St Wenceslaus is celebrated as festum fori, which, according to Grotefend, occurs only in Wrocław, Kraków, Olomouc, and Prague ( Grotefend
). As in Wrocław and Kraków, St Wenceslaus is also celebrated as festum duplex (Olomouc: solemne); his translation - also observed in Wrocław, Kraków, Olomouc, and Prague - is celebrated on March 8 as festum semiduplex. Notably, however, neither the Passio Ludmille characteristic of Prague and Olomouc (September 16), nor the Ossium recollectio of St Wenceslaus characteristic of Prague (June 27) is included. As in Wrocław and Olomouc, the feast of St Cunigunde is celebrated September 9 but as both festum duplex and festum fori, as are the two feasts of St Augustine (August 28 and October 11). Also notable is the inclusion in the missal of St Potentius (June 18) and St Genebald (September 5); Genebald is, according to Grotefend, local to to Laon and Potentinus to Cologne. Both are associated with the Premonstratensians ( Grotefend
). The Dedicatio ecclesie is celebrated on April 16. In a letter to the National Library dated , Professor Wilhelm Pinder, dates the drawing on to around 1380. In a note stamped , Dr Jaroslav Polc of the Pontifical Lateran University dates the manuscript to c. 1390, noting that the feast of Sts Cyril and Methodius, which is an addition to the calendar, was instituted in that time, and that the feast of Visitation, instituted in 1389, is also an addition. Finally, the feast of St Sigismund, a later addition both to the calendar and the missal text, was instituted in 1356 but not, according to Polc, observed until later. A former librarian at the National Library, furthermore, has noted that April 16 is listed in the calendar as Dominica Iubilate and conjectures, based on this, that the missal was produced in a year when Easter Sunday occurred on March 26, which would mean either 1391 or 1402.

history.provenance:
It is not known how the manuscript came to the National Library. Drake Boehm and Fajt suggest that it was brought to Sweden by Queen Christina (
                                Drake Boehm and Fajt

                            ), but this hs not been able to be confirmed.  It is listed as No. 19 in the catalogue of 1734 (U 125e), and as e. 30. 6. 12. in Hammarsköld's catalogue of the 19th century (U 133).

